import React from 'react'
import { Header } from './headerStyle'
class header extends React.Component {
    constructor() {
        super()
        this.state = {
            lunch: "lunch active",
            dinner: "dinner"
        }
    }

    dateItem = (props) => {
        return (
            <button className="dateItem" active={props} >
                <span className="day">SEN</span>
                <span className="date">10</span>
            </button>
        )
    }

    btnLunch = (props) => {
        if (props === "lunch") {
            return (
                this.setState({
                    lunch: "lunch active",
                    dinner: "dinner"
                })
            )
        }
    }

    btnDinner = (props) => {
        if (props === "lunch") {
            return (
                this.setState({
                    lunch: "lunch",
                    dinner: "dinner active"
                })
            )
        }
    }


    render() {
        return (
            <Header>
                <div className="headerNav">
                    <button>
                        <span className="material-icons"> arrow_back</span>
                    </button>
                    <div className="navSideRight">
                        <div className="upTxt">
                            <p>Alamat Pengantaran</p>
                        </div>
                        <button className="botTxt">
                            <p>Tokopedia Tower</p>
                            <span className="material-icons"> keyboard_arrow_down</span>
                        </button>
                    </div>
                </div>

                <div className="headerDate">

                    {this.dateItem("true")}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                    {this.dateItem()}
                </div>

                <div className="divider"></div>

                <div className="headerBtnList">
                    <button onClick={this.btnLunch} className={this.state.lunch}>{this.state.lunch}</button>
                    <button onClick={this.btnDinner} className={this.state.dinner}>{this.state.dinner}</button>
                </div>
            </Header>
        )
    }
}

export default header
